import React from 'react';
import Link from 'next/link';

const NoticeList = (props, {onChage}) => {

    const lists = props.props;

    return(
    <>
        <div>
            {lists && lists.map(list => (
                <>
                    <Link href='/noticeDetail'><li props={list} key={list.NTC_ID} onClick={onChage}>{list.NTC_TITLE}</li></Link>
                </>
            ))}
        </div>
    </>
    )

};

export default NoticeList;
